def recieveData(s):
    try:
        data = s.recvfrom(65565)
        return data[0]
    except timeout:
        data = "timeOut"
    except:
        print ("An error happened")
        sys.exc_info()

#get the time of service and it is 8 bits long
def getTOS(data):
    precedence = {0:"Routine",1:"Priorty",2:"Immediate",3:"Flash",4:"Flash override",5:"CRITIC/ECP",6:"Internetwork Control",7:"Network Control"}
    delay = {0:"Normal delay",1:"Low delay"}
    throughput = {0:"Normal throughput",1:"high throughput"}
    reliability = {0:"Normal Reliability",1:"High reliability"}
    cost = {0:"Normal monetary cost",1:"Minimize monetary cost"}

    D = data & 0x10
    D >>= 4
    T = data & 0x8
    T >>= 3 
    R = data & 0x4
    R >>= 2    
    M = data & 0x2
    M >>= 1    
    
    tabs = "\t\t\t"
    TOS = precedence[data >> 5] + tabs + delay[D] + tabs + throughput[T] + tabs + reliability[R] + tabs + cost[M]
    return TOS

def getFlags(data):
    flagR = {0:"0 - Reserved bit"}
    flagDf = {0:"0 - Fragment if necessary",1:"1 - Do not fragment"}
    flagMf = {0:"0 - last fragment",1:"1 - More fragments"}
    
    R = data & 0x8000
    R >>= 15
    Df = data & 0x4000
    Df >>= 14
    Mf = data & 0x2000
    Mf >>= 13
    
    tabs = "\t\t\t"
    flags = flagR[R] + tabs + flagDf[Df] + tabs + flagMf[Mf]
    return flags,int(R),int(Df),int(Mf)

